import React, { Component } from "react";
import { connect } from 'react-redux';

// 컴포넌트
import HeaderContainer from "./HeaderContainer";
import SearchIcon from "../components/SearchIcon";
import {  } from "../components/";

// 액션
import {
    getNetworkRequest
} from "../store/actions/network"

import { 
    headerOn,
    searchBarOn,
    categoryOn
} from "../store/actions/structure";

class NetworkingContainer extends Component {    

    componentDidMount() {
        this.props.headerOn();
        this.props.searchBarOn();
        this.props.categoryOn();
    }

    render() {
        return (
            <div>
                <HeaderContainer
                    title='Networking'
                />


                <SearchIcon
                    isHeaderOn={this.props.isHeaderOn}
                    headerOn={this.props.headerOn}
                />
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        isHeaderOn: state.structure.isHeaderOn
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        headerOn: () => {dispatch(headerOn())},
        searchBarOn: () => {dispatch(searchBarOn())},
        categoryOn: () => {dispatch(categoryOn())}
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(NetworkingContainer);
